import React from "react";

import Header from "./Header";
import Footer from "./Footer";
import DrawStudio from "./DrawStudio";
import ShowAvailable from "./ShowAvailble";

import "../styles/layout.css"

type Object = {
    x: number;
    y: number;
    type: "chair" | "table" | "sitting";
};

type Info = {
    time: number
    data: Object
}

const objects: Object[] = [
    { x: 50, y: 50, type: "chair" },
    { x: 150, y: 100, type: "table" },
    { x: 250, y: 150, type: "chair" },
    { x: 350, y: 200, type: "table" },
];

const MobileLayout = ({props} : any) => {
        const [data, setData] = useState<Props[]>([])

    const getData = async () => {
        const res = await fetch(
            "http://10.18.243.73:3000/data"
        ).then((res) => {
            return res.json()
        })

        const initData = res.slice(0, 20).map((it: any):Props => {
            const info:Info = {
                time: it.time,
                data: it.data,
                now: new Date().getTime()
            }

            const props: Props = {
                objects: info,
            }

            return props
        })
        setData(initData)
    }

    useEffect(() => {
        getData()
        console.log(data)
    }, [])
    return (
        <>
            <Header />
            <div className="container_mobile">
                <div className="up_mobile">
                    <DrawStudio objects={objects} />
                </div>
                <div className="down_mobile">
                    <ShowAvailable objects={objects} />
                </div>
            </div>
            <Footer />
        </>
    )
}

export default MobileLayout
